import React from "react";

const ChooseLang = () => {
  return (
    <div>
     <p>Google offered in:
         <a href="https://google.com" className="link">
        українська
      </a>
      <a href="https://google.com" className="link">
         portugal
      </a>
     </p>

    </div>
  );
};

export default ChooseLang;
